        return (
            <BrowserRouter>
                <div>
                    <header>
                        <div style={{ backgroundColor: "Yellow" }}>
                            <h2><center>Admission Form</center></h2></div>

                        <nav style={{ paddingBottom: "20px" }}>
                            <Link style={{ paddingRight: "10px" }} to="/">Apply Form</Link>
                        </nav>
                    </header>
                    <b style={{ marginBottom: "10px;" }}>The Area below will be Updated</b><br /><br />
                    <Route exact path="/" component={ApplyFormComponent}></Route>
                </div>
            </BrowserRouter>
        )
    }
}


